import { Route, Routes } from "react-router-dom";
import RegistrationPage from "./pages/RegistrationPage";
import HeaderNav from "./components/HeaderNav";

function App() {
	return (
		<div>
			<div className="mx-20">
				<Routes>
					<Route path="/register" element={<RegistrationPage />} />
				</Routes>
			</div>
		</div>
	);
}

export default App;
